window.bookSummaryJSON = "<p><b>From YouTube superstars and creators of <i>Good Mythical Morning</i> comes the ultimate guide to living a \"mythical\" life, featuring stories from their lifelong friendship as well as tips for laughing more, learning more, and never taking yourself too seriously.</b> </p> <p>\"Internetainers\" Rhett &amp; Link met in first grade, when their teacher made them miss recess for writing profanity on their desks, and they have been best friends ever since. Today, their daily YouTube talk show, <i>Good Mythical Morning</i>, is the most-watched daily talk show on the Internet, and nearly 12 million subscribers tune in to see the guys broadcast brainy trivia, wild experiments, and hilarious banter (not to mention the occasional cereal bath). Now, the award-winning comedians are finally bringing their \"Mythical\" world to their first book. </p> <p>A hilarious blend of autobiography, trivia, and advice, <i>Rhett &amp; Link's Book of Mythicality: A Field Guide to Curiosity, Creativity, and Tomfoolery</i> will offer 20 ways to add \"mythicality\" to your life, including: </p> <p></p> <ul> <li>Eat something that scares you </li> <li>Make a bold hair choice </li> <li>Invent something ridiculous </li> <li>Say \"I love you\" like it's never been said </li> <li>Speak at your own funeral </li> </ul> <p></p> <p>The goal of these offbeat prompts? To learn new things, laugh more often, and earn a few grown-up merit badges along the way. Heartfelt and completely original, this book will be the perfect gift for anyone looking for a fresh dose of humor and fun. </p> <p>Rhett &amp; Link, best friends since the first grade, are an LA-based comedic duo known for hosting the most-watched daily talk show on the Internet, <i>Good Mythical Morning</i>, their narrative series <i>Rhett &amp; Link's Buddy System</i>, and the award-winning weekly podcast <i>Ear Biscuits</i> as well as their wildly popular comedic songs, sketches, and viral low-budget local commercials. Rhett &amp; Link's YouTube channels have a combined subscriber base of over 19 million people, with over four billion total views. They have been featured on and in <i>The Tonight Show with Jimmy Fallon</i>, <i>The Conan O'Brien Show</i>, <i>Variety</i>, <i>USA Today</i>, and <i>Mashable</i>. </p>"; 
